import React from "react";
import { Typography } from "@material-ui/core";
import Job from "./Job";

const Jobs = ({ jobs }) => (
        <div className="jobs">
            <Typography variant="h1">
                Entry Level Software Jobs
            </Typography>
            {
                jobs.map(
                    (job) => console.log(job)
                )
            }
        </div>
    );
export default Jobs;
